"244259":{"id":"244259","name":"Thank You, Goodnight: A História de Bon Jovi","slug":"thank-you-goodnight-a-historia-de-bon-jovi","original_title":"Thank You, Goodnight - The Bon Jovi Story","overview":"O passado épico e o futuro incerto da icônica banda Bon Jovi.","first_air_date":"2024-04-26","episode_run_time":0,"vote_average":7.4,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Religion of Sports"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/2Z4asSxxl2OoMVOsaTz1hYpDCrn.jpg","poster_path":"https://image.tmdb.org/t/p/original/s1FpTxoVaHXBig2vN0brZRRJzFA.jpg","cast":["Jon Bon Jovi","David Bryan","Tico Torres","Hugh McDonald","Phil X"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/s1FpTxoVaHXBig2vN0brZRRJzFA.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/s1FpTxoVaHXBig2vN0brZRRJzFA.jpg","air_date":"2024-04-26","episode_count":4,"overview":"N/A","vote_average":8.8,"episodes":{"1":{"name":"Nova Jersey Contra Todos","overview":"Na adolescência, Jon se apresentava em bares e voltava correndo para a escola logo depois. Agora, perto de completar 60 anos, ele reflete sobre os últimos 40 anos. Será que ele vai conseguir dar um show que consolidará seu legado ou será que uma lesão fora de seu controle o afastará dos palcos?","air_date":"2024-04-26","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/3PnxGflBVEloS56beEDi97524pw.jpg","vote_average":8.5},"2":{"name":"De Lugar Nenhum para Todos os Lugares","overview":"A banda se torna famosa da noite para o dia, mas as tensões aumentam mesmo com o sucesso da Bon Jovi. O coquetel de fadiga versus ambição evidenciado na apresentação em Guadalajara, no México, pode ser o fim da banda Bon Jovi.","air_date":"2024-04-26","runtime":93,"still_path":"https://image.tmdb.org/t/p/original/9dvaaXBdXm70IkzvzkHJWmoTdPE.jpg","vote_average":9.5},"3":{"name":"Irmãos de Armas","overview":"Com uma perspectiva renovada, Bon Jovi se apresenta a uma nova geração de fãs na virada do milênio com um som novo e a mesma reputação icônica... até que a banda é destruída pela saída repentina e dolorosa de Richie.","air_date":"2024-04-26","runtime":73,"still_path":"https://image.tmdb.org/t/p/original/uo4FWHoYIoZLgltPdQwuVSw3Wvl.jpg","vote_average":8},"4":{"name":"Legendário","overview":"Após a partida repentina de Richie, Jon mergulha na escuridão. Com o tempo parado durante a pandemia, a recuperação de sua cirurgia e o marco de seu 60º aniversário, Jon fica apenas refletindo... será que se tornou o homem que estava destinado a ser?","air_date":"2024-04-26","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/4ZS4B0Jui9brg6mBezteCruJKx6.jpg","vote_average":9}}}}},
