"206566":{"id":"206566","name":"Perdido no Amor","slug":"perdido-no-amor","original_title":"Yang Hilang Dalam Cinta","overview":"Enquanto se prepara para o seu casamento, Dara desaparece de repente. Satria, apaixonado por ela desde a infância, é o único que consegue vê-la, tocar-lhe e falar com ela.","first_air_date":"2022-07-30","episode_run_time":0,"vote_average":6,"number_of_seasons":1,"number_of_episodes":12,"created_by":["Yandy Laurens","Suryana Paramita"],"production_companies":["Starvision Plus","Cerita Films"],"genres":["Drama","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/cTGgnAscrdpziPiOiWNAtEfl6pm.jpg","poster_path":"https://image.tmdb.org/t/p/original/wbu5WTn4qIDguhAK2SlER5wevgD.jpg","cast":["Sheila Dara Aisha","Dion Wiyoko","Reza Rahadian","Ringgo Agus Rahman","Dwi Sasono"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/wbu5WTn4qIDguhAK2SlER5wevgD.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/wbu5WTn4qIDguhAK2SlER5wevgD.jpg","air_date":"2022-07-30","episode_count":12,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"A Que Desaparece","overview":"Enquanto Dara se prepara para o seu casamento com Rendra, uma pequena discussão tem resultados inesperados. Felizmente, o seu amigo de infância Satria consegue vê-la, tocar-lhe e falar com ela.","air_date":"2022-07-30","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/ki9RflWBx6fy8gXfkmjba62QdgD.jpg","vote_average":0},"2":{"name":"A Que Sabe","overview":"Dara não é apenas invisível; ela não consegue tocar em nada nem em ninguém. Considera suicidar-se, mas, como que por milagre, Satria consegue vê-la, falar com ela e tocar-lhe. Ele também consegue alimentá-la e ajudá-la a sobreviver.","air_date":"2022-07-30","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/lOEAB8E4CxZTiG0d2EtZUlQqcwu.jpg","vote_average":0},"3":{"name":"A Que Espera Pela Altura Certa","overview":"Enquanto Satria se esforça para ajudar Dara, o detetive responsável pelo caso começa a suspeitar dele. Dara descobre que Satria não contou a Rendra sobre a sua situação.","air_date":"2022-08-06","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/sDZJXlyZaEIGALwb0JroZdlX990.jpg","vote_average":0},"4":{"name":"A Que Vai Embora","overview":"Satria revela a situação de Dara a Rendra, mas ele não reage como ela esperava.","air_date":"2022-08-06","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/mxLTmTh07hr5bRmyi3jCJWWX1hD.jpg","vote_average":0},"5":{"name":"Coisas Que Voltam A Crescer","overview":"De coração partido, o problema de Dara piora, e Satria pede ajuda aos amigos. Dara sente cada vez mais que é um fardo para os que a rodeiam e insiste que Satria viva a sua vida sem ela.","air_date":"2022-08-13","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/emmBDllwplh8CYcp4yWqmdJKJ2q.jpg","vote_average":0},"6":{"name":"Coisas Que São Reveladas","overview":"Quando a polícia tenta resolver o caso, Rendra insiste que este seja fechado, deixando Satria e Dara livres para desfrutar um dia sozinhos. Como resultado, algo inesperado acontece.","air_date":"2022-08-13","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/2C4b5JOmW3YWSWh2etYMkzBAhQU.jpg","vote_average":0},"7":{"name":"Aquela Que Escolhe","overview":"A polícia questiona Satria e Dara. Rendra conforta Dara e decide voltar para Rendra, deixando Satria de coração partido. A organização do casamento deles é apressada.","air_date":"2022-08-20","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/4DjNscOUuThDr7SxWL79jboj5AK.jpg","vote_average":0},"8":{"name":"Coisas do Passado","overview":"As preparações são apressadas e concluídas, e o dia do casamento chega. No entanto, Rendra e Dara voltam a discutir, e ela torna-se invisível. Os seus traumas passados são revelados.","air_date":"2022-08-20","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/udvfGMpB567mnn6tKTXYoDhNtB6.jpg","vote_average":0},"9":{"name":"Aquela Que Persiste","overview":"Com Dara invisível até para Satria, ela não tem como se manter, tornando-se cada vez mais fraca. Satria não desiste de tentar encontrar Dara e ajudá-la.","air_date":"2022-08-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hXx8p0N73kL9FdfXUk7WfNC8Vis.jpg","vote_average":0},"10":{"name":"A Que Se Lembra","overview":"Sem esperança, Satria tenta seguir em frente, mas não consegue esquecer os seus sentimentos por Dara. Algo inesperado acontece quando ele revela a profundidade e força do que sente por ela.","air_date":"2022-08-27","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/ct8x47lKddrBGmtY62zCpuZRFJR.jpg","vote_average":0},"11":{"name":"A Que Esquece Tudo","overview":"Dara é hospitalizada, e com Satria do seu lado, ela recupera lentamente. No entanto, não consegue esquecer a sua relação não resolvida com Rendra e toma uma decisão perigosa.","air_date":"2022-09-03","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/gMgaooZUzYTCl5iVJ16g5zb0S9M.jpg","vote_average":0},"12":{"name":"A Integridade Interior","overview":"Satria tem de esquecer Dara, pois sabe que ela tem de se amar a si primeiro para recuperar totalmente. Vários anos depois, um encontro inesperado muda os seus planos.","air_date":"2022-09-03","runtime":34,"still_path":"https://image.tmdb.org/t/p/original/ljaNrvvN4PFMAWiEAyJewwomvQO.jpg","vote_average":0}}}}},
"158762":{"id":"158762","name":"3 Tonelada$: Assalto ao Banco Central","slug":"3-tonelada-assalto-ao-banco-central","original_title":"3 Tonelada$: Assalto ao Banco Central","overview":"Em 2005, ladrões cavaram um túnel até o Banco Central do Brasil em Fortaleza, levando mais de 160 milhões de reais. Esta série documental relata o roubo histórico.","first_air_date":"2022-03-16","episode_run_time":60,"vote_average":6.4,"number_of_seasons":1,"number_of_episodes":3,"created_by":["Rodrigo Astiz","Nikolas Fonseca","Daniel Billio"],"production_companies":["Mixer Films"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/rhO9JVT6VCsPNx6aNddqHmZHDQM.jpg","poster_path":"https://image.tmdb.org/t/p/original/qzYfiX3t8b9Kg7RhAHl5WDi5usI.jpg","cast":[],"trailer":"x0bLgnTINpY","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qzYfiX3t8b9Kg7RhAHl5WDi5usI.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qzYfiX3t8b9Kg7RhAHl5WDi5usI.jpg","air_date":"2022-03-16","episode_count":3,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"O Crime","overview":"As autoridades investigam um assalto audacioso: criminosos cavaram um túnel e roubaram milhões do Banco Central de Fortaleza.","air_date":"2022-03-16","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/63Rlsoz0pF2Jt00KVFDdQC4vaZt.jpg","vote_average":10},"2":{"name":"A Caçada","overview":"A caça aos culpados leva os investigadores até Boa Viagem, no Nordeste do Brasil. A polícia descobre outro evento interligado e se aproxima de um dos mentores do crime.","air_date":"2022-03-16","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/vyOguLZE4gvtTdqbYSfrN8WuTYX.jpg","vote_average":0},"3":{"name":"Dinheiro Maldito","overview":"O dinheiro resulta em uma espécie de maldição: os ladrões viram alvo de sequestro e extorsão por parte de policiais corruptos e morrem de formas suspeitas.","air_date":"2022-03-16","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/bzDHZY2hwogSHOWrJuqCiryRjhW.jpg","vote_average":0}}}}},
